    "overview": "Kefalínia időtlenül és elfeledetten magaslik a Jón tenger szikrázó türkizéből, és lakói fenntartás nélkül imádják ezt a földet. A természet cudarul bánt Kefalíniával, dühödt földrengések rázták meg a szigetet, mely csöndes méltósággal viselte sorsát, őrizte hagyományait és mítoszait nemzedékeken át... egészen 1941-ig, amikor egy háború, mely lángba borította a földet, elérte a sziget békés partjait is.\r Amikor Antonio Corelli és százada megérkezik a szűz szigetre, ott tartózkodásukat úgy fogják fel, mint afféle görög vakációt, ahol a háború csak egy távoli rádióüzenet. Az igéző szépségű fiatalasszony, Pelagia és a többi falusi eleinte neheztel a váratlan vendégekre, de végül az olaszok kedvessége és életszeretete feloldja az ellentéteket, és Pelagia meglátja Corelliben azt az embert, aki valójában benne lakozik, és aki imádja az életet, a zenét, sőt, a lányt is.",
