    "overview": "2001. szeptember 11. szokatlanul meleg nap volt New Yorkban. Will Jimenónak, a kikötői rendőrség (PAPD) tisztjének megfordult a fejében, hogy kivesz egy szabadnapot és hobbijának, az íjászatnak hódol, de azután mégis úgy döntött, bemegy dolgozni. John McLoughlin őrmester, a PAPD köztiszteletben álló veteránja akkor már órák óta ébren volt, mivel minden reggel másfél órát kellett utaznia, míg beért a városba. A két férfi és kollégáik mind Manhattan központja felé tartottak, ahogy mindennap. Ám ez a nap más volt, mint a többi. A riasztásra elsőként reagáló PAPD csapat Manhattan központjából a World Trade Centerhez vonult. Öt férfi, köztük McLoughlin és Jimeno, bementek az épületekbe, és csapdába estek a romok alatt, amikor a tornyok összeroskadtak. Csodával határos módon McLoughlin és Jimeno életben maradtak, de hat méter mélyre temették őket a betontömbök és fémdarabok.",
