    "overview": "Váratlan érzelemkitörést okoz a telehold a negyvenhez közeledő, csinos brooklyni özvegyasszony egyhangú életében. Pedig Loretta már lemondott az önfeledt boldogságról. Éppen elhatározta, hogy férjhez megy az egyszerű és szeretetreméltó udvarlójához, Johnny Cammarerihez. Megismerkedik azonban Ronnyval, leendő férjének az öccsével. A sógorral töltött szerelmes éjszaka után érzéki szépasszony lesz belőle. Nem csak őt bolondítja meg az égi tünemény, idős rokonai is bejárják a szerelem, a gyönyör és a féltékenység útját.",
