    "original_title": "National Treasure",
    "overview": "Benjamin Franklin Gates (Cage) archeológus - családja hét korábbi generációjához hasonlóan - egy különös kincs megtalálására szenteli életét. A Gates család titkos legendája úgy tartja, hogy George Washington, Thomas Jefferson és Benjamin Franklin Amerika Függetlenségi háborúja idején egy jelentős arany-tartalékot rejtett el \"szűkösebb napokra\", és az arany rejtekhelyéhez az Alkotmány, valamint a Függetlenségi Nyilatkozat eredeti példányaiban található titkos utalások vezetnek el. Gates-nek nincs semmilyen kézzelfogható bizonyítéka arra, hogy a legendának bármilyen valóságalapja lenne, mégis teljes erőbedobással fog hozzá a titkos kód feltöréséhez és a kincs megtalálásához. Hamarosan azonban mások is értesülnek a kincsről, és megindul a hajtóvadászat.",
