    "original_language": "en",
    "original_title": "The Cotton Club",
    "overview": "Cotton Club, a híres harlemi jazz klub, a 20-30-as években vált híressé, mint a zenészek mekkája és a maffiózók székhelye. Ez a hely az amerikai társadalom kaleidoszkópja a gazdasági válságot megelőzően, az alvilág és a zenészek felsőbb rétegének találkozóhelye, melyet Coppola és a híres író, Mario Puzo, ideális témának tartottak egy film elkésztéséhez. 1928-at írunk. A fehér bőrű Dixie Dwyer (Richard Gere) trombitásként egy néger jazz bandában zenél. Véletlenül megmenti Dutch Schultz (James Remar), a hírhedt maffiózó életét, aki hálából munkát ajánl a zenésznek: játszhat Schultz szeretőjének, Vera Ciceronak, a fogadásán. Dixie gondjai a gyönyörű nővel való találkozás után kezdődnek.",
