    "overview": "Charlie Kaufman (Nicolas Cage) úgy ír, ahogy él: nagy nehezen. Ikertestvére, Donald (Nicolas Cage) pedig úgy él, ahogy ír: õrülten és lazán. Susan (Meryl Streep) az életrõl akar írni, de nem is ismeri. John (Chris Cooper) élete pedig könyvért kiált. Négy élet - egy történet. Amely millióképpen érhet véget. Az elmésen felépített történet fõhõse Charlie, akinek záros határidõn belül filmforgatókönyvet kell írnia egy bizonyos Susan \"Az orchidea-rabló\" című könyvébõl. Mindenki hajtja a munkában, de Charlie semmire sem jut. Szerinte az egész nem filmrevaló. Ráadásul idegesíti ikertestvére is, aki zöldfülű forgatókönyvíróként máris több tehetséget mutat nála. A könyvben John az orchidea-rabló, aki mégis rabul ejti Charlie érdeklõdését, ahogy annak idején az írónõét is. A készülõ adaptációban végül is mindenkinek megvan a maga helye. Vagy nincs.",
