    "overview": "Charlie Lang semmi másra nem vágyik, mint hogy jó zsaru, segítőkész szomszéd, szerető férj és jó apa legyen. Murielnek, a feleségének viszont minden gondolata a pénz körül forog. Egy nap Charlie munka közben egy olyan kávézóban ebédel, melynek pincérnőjét, Yvonne-t kisemmizte felelőtlen férje. Amikor a férfi észreveszi Yvonne szomorúságát, megpróbálja felvidítani, de munkája elszólítja és amikor fizetni készül, akkor veszi csak észre, hogy nincs nála pénz borravalóra. Van azonban egy lottószelvénye, ezért megígéri Yvonne-nak, hogy ha kihúzzák a számait, megfelezi vele a nyereményt. És csodák-csodája Charlie megüti a négymillió dolláros főnyereményt.",
