    "overview": "Íme az eszelős szenvedély és a kitartó, makacs barátság története. Nicolas Cage és Matthew Modine alakításában, két nagyszerű színész előadásában ismerkedhetünk meg a fiúval, aki madárrá szeretne válni és barátjával, aki nem hagyja, hogy gyermekkori társa örökre magára maradhasson egy elmegyógyintézet szomorú falai között. Birdy, a madárka egyetlen vágya mindig a repülés volt. De különös szokásai a vietnámi csataterek borzalmai között egészen hatalmukba kerítették. A háború ébresztette rá arra, hogy nem akar ember lenni. Álom és valóság, rémálom és még rémesebb valóság képei kavarognak benne. Két világ között kell választania.Alan Parker csodálatos, felkavaró, nehezen felejthető filmet készített. Akinek van szíve, annak szárnyakat ad. (port.hu)",
