    "overview": "Jimmyt tovább kísérti a múltja. Egy éjszaka unokaöccse, Ronnie dörömböl az ajtaján és segítségért könyörög. Egy kamionnyi lopott autó vár arra, hogy leszállítsák a megrendelőnek, de nincs sofőr. Ha Jimmy nem vállalja a fuvart, Ronnie a halál fia - a maffia nem ismer kegyelmet. Jimmy persze segít Ronnie-nak, de útközben rajtuk ütnek a zsaruk, s a lövöldözésben meghal egy rendőr. Ronnie megússza, de Jimmy lakat alá kerül. A férfi ismeri a maffia hallgatási törvényét és néma marad. Amikor azonban megtudja, hogy minden barátja és rokona elárulta őt, és rájön arra, hogy Ronnie a feleségét elcsábította, elhatározza, hogy büntetése enyhítéséért cserébe segít lebuktatni Little Junior Brownt, a veszélyes maffiafőnököt.",
