    "original_title": "Kick-Ass",
    "overview": "A tini Dave rajong a képregényekért. A szuperhősökről olvasva elfelejti, milyen jelentéktelen az életben, azt, hogy nincs érzéke semmihez, a lányok meg átnéznek rajta. A srác gondol egy merészet, és elhatározza, hogy a példaképeit követve felcsap szuperhősnek. Testhezálló jelmezt rendel a netről, nevet ad magának, és elindul, hogy megtisztítsa városát a bűntől. Elszántságának csak a szuperképességek hiánya szab gátat. A felbukkanásának mégis híre megy. Ezzel felkelti az igazi \"hős\" apuka és a tizenegy éves, karatézó lánya érdeklődését. Jól jön a segítségük a helyi maffiafőnök elleni küzdelemben.",
