    "overview": "Terence McDonagh velejéig korrupt, drog és szerencsejáték-függő nyomozó, aki a Katrina hurrikán sújtotta New Orleansban nyomozni kezd egy szenegáli család meggyilkolása ügyében. Hátfájására szedett gyógyszerei egyre kevésbé segítenek, kokainfüggősége kezd elhatalmasodni rajta, mégis meg tudja győzni főnökét, hogy ő a legjobb választás. Talál egy szemtanút, aki vallana az elsőszámú gyanúsított, egy nagyhatalmú drogdíler ellen, de a fiú eltűnik. A lefelé tartó spirál akkor gyorsul be, amikor Terence prostituált szeretőjét megveri egy kuncsaftja, és 50 ezer dollárt követel az életéért cserébe. A zsaru üzletelni kezd a gengszterekkel, védelmet ígérve némi százalékért és kábítószerért. Hiába válik jelleme egyre mocskosabbá, jól keveri a kártyákat így karrierje felfelé ível.",
