    "overview": "Tom Welles magándetektívként dolgozik az egyik pennsylvaniai kisvárosban. Miközben a nagy kihívásról álmodik, leginkább házasságtörési ügyekkel és más piti dolgokkal foglalkozik. Egyik nap azonban különös feladattal bízzák meg. Az idős és dúsgazdag özvegyasszony a férje páncélszekrényében régi, nyolcmilliméteres filmtekercset talált. A pornófilmen halálra kínoznak egy lányt. Az asszony arra kéri a magánnyomozót, hogy járjon utána, ki lehet az áldozat. A nyomozás Wellest a társadalom legsötétebb, legmocskosabb bugyraiba vezeti.",
