    "original_title": "Bringing Out the Dead",
    "overview": "Ön eddig azt hitte, hogy munkája maga a pokol? Frank (Nicolas Cage) szerette munkáját, de az állandó stressztől kiégett az évek során. Minden telefonhívás lehet egy gyilkosság, akár baleset, emberi tragédia. A manhattani éjszakában Frank társaival mentőzik. Lelkiismeretfurdalás gyötri az elvesztett életek miatt. Sokszor megjelenik előtte egy fél évvel korábban meghalt nő arca, aki megmenthető lett volna. Ki akar lépni munkájából, de valami mégis mindig visszahúzza. Frank és kollégái életét három éjjelen át követhetjük. Larry (John Goodman) örökké éhes, Marcus (Ving Rhames) vallásos fickó, Tom (Tom Sizemore) pedig agresszív egyéniség, ha nem történik semmi...\r Martin Scorsese újra szeretve-gyűlölt városának árnyoldalait mutatja be emberien és mesterien.",
