    "original_title": "Snake Eyes",
    "overview": "Atlantic City - fény, csillogás, kaszinók, bokszmeccsek és főleg, ami körül az egész forog: pénz, pénz, pénz. Rick Santoro nyomozó (Nicolas Cage) élete szorosan összefonódik ezzel a világgal - mindenkit ismer, mindenki a haverja, minden meccsen ott van, és minden pénzt bekasszíroz, amihez egy rendőr törvényes - vagy törvénytelen - úton hozzájuthat. A hatalmas arénában 14 ezer néző várja az évszázad bokszmérkőzését. Az első sorban természetesen ott ül Rick, barátja, a magas rangú katonatiszt, Kevin Dunne (Gary Sinise) társaságában, aki meccs díszvendégének, az Egyesült Államok védelmi miniszterének biztonságáért felel. Röviddel a mérkőzés kezdete után azonban a minisztert halálos lövés éri. Az arénában kitör a pánik. A nagyhangú, korrupt zsaru élete legnagyobb próbatétele elé kerül: 14 ezer ember között kell megtalálnia a miniszter gyilkosát. Magányos harcában csupán néhány videofelvétel és egy rejtélyes nő segíti.",
