    "overview": "A második világháborúban sajátos eszközhöz folyamodott az amerikai hírszerzés a csendes-óceáni hadszíntéren. Navajo indián tengerészgyalogosakat képeztek ki rádiósoknak, akik a bonyolult kódolás helyett a saját anyanyelvükön továbbították a parancsokat. Joe Enders és Ox Anderson tengerészgyalogost két indián, Ben Yahzee és Charlie Whitehorse személyes védelmével bízzák meg. A kezdeti ellenérzés után, a Szaipan-sziget elleni támadás során a katonák között baráti kapcsolat alakul ki. Lassanként ráébrednek, mit jelent valójában ez a feladat.",
