    "overview": "Filmünk főhőse, Jack retteg a házasságtól. Különben is, édesanyja halálos ágyán megígérte, hogy soha nem nősül meg, és eddig állta is a szavát. Igen ám, de élete párja, Betsy (Sarah Jessica Parker) ultimátum elé állította: vagy házasság, vagy örök harag. Jack remek áthidaló megoldást javasol: utazzanak el Las Vegasba és keljenek egybe egy gyorskápolnában. Betsy beleegyezik, és mire Jack halálra rémülhetne, addigra meg is érkeznek. És csodálatos dolog történik: egy profi szerencsejátékos (James Caan) megpillantja a lányt, aki a megszólalásig hasonlít boldogult feleségére. Meg kell szereznie őt magának, bármi áron. Ráveszi Jack-et egy pókerpartira, melynek tétje nem más, mint maga a menyasszony. És innen persze már nincs visszaút.",
