    "original_title": "Gone in Sixty Seconds",
    "overview": "Minden szakmának megvannak a maga sztárjai: ha autótolvajra van szükség, Memphisnél (Nicolas Cage) nincs jobb. Gyors, pontos, megbízható és nem ismer lehetetlent. Ám ezúttal ő sem hisz benne, hogy sikerülhet. Ötven jól őrzött luxusautót kell egy éjszaka alatt elkötnie és biztos helyre vezetnie. Azonnal nemet mondana, ha nem a maffia volna a megbízója és a tét nem az öccse élete lenne. Hamarosan összeáll a csapat és turbósebességgel felpörögnek az események, miközben üldözések, cselek, hazugságok, árulások és karambolok követik egymást szédült tempóban.",
