    "overview": "1959-ben, egy iskolai avatóünnepségén elteszik a gyerekek elképzelt jövőt ábrázoló rajzait. Van köztük egy, amelyik nem rajzot, hanem véletlenszerűnek tűnő számsorokat tartalmaz. Ötven évvel később diákok elemzik a gyermekrajzokat. A kislány által írt számok Calebhez kerülnek, aki megmutatja azt az apjának, a híres asztrofizikusnak. John Koestler megdöbbenve fedezi fel, hogy a számok dátumokat jelentenek, amelyek a világot sújtó nagy katasztrófák időpontját jelzik. A számsort összeállító kislány lánya, Diana segítségével, Koestler versenyt fut az idővel, hogy megakadályozza a végső katasztrófát.",
