    "overview": "Croodék igazi modern család. Abban az ősi, elfeledett korban élnek, amikor a természet még kísérletező szakaszában van: fura lények és növények veszi körül vagy próbálják megenni őket, és ők nem hagyják magukat. Sokáig nem dugják ki az orrukat a barlangjukból, de egy szerencsétlen baleset következtében kénytelenek előjönni, és attól kezdve számukra csupa kaland, meglepetés és váratlanul felbukkanó húsevő az élet. Azután találkoznak egy fiatalemberrel, aki született kísérletező. Ráadásul megtetszik neki a család kamaszlánya – és vele együtt szeretné felfedezni ezt a folyton fejlődő, ismeretlen, de nagyon érdekes világot.",
