    "overview": "Johnny Blaze (Nicolas Cage) megszokta a halál közelségét: ő a száguldó világ legvakmerőbb motoros kaszkadőre. Amikor egy különös idegen a lelkét kéri cserébe súlyosan beteg apja felgyógyulásáért, nem habozik: számára a Mefisztóval (Peter Fonda) kötött üzlet csupán egy újabb kaland, újabb játék a halállal. De az alvilág urával nem lehet játszani. Johnny örök rabságba kerül. Nappal továbbra is lélegzetelállító trükkjeivel szórakoztatja a borzongani vágyókat, éjjel viszont a gonoszak ellen kell harcolnia: akit legyőz, azt a pokol tüzével bünteti. Lángoló motorja nyergében minden éjjel nekivág szörnyű büntetőhadjáratának - és hiába szeretne, nem nyugodhat meg sosem.",
