    "overview": "Peggy Sue válni készül, amikor a huszonöt éves osztálytalálkozóján különleges dolog történik. Elájul, majd kábulatából negyed évszázaddal fiatalabban ébred. Tinédzserként a hatvanas években találja magát, ráadásul mindent tud a jövőről! Tudja, hogy a jóképű Charlie, aki a szelet csapja neki, egyszer majd züllött, megbízhatatlan alak lesz, aki megkeseríti az életét. És tudja, hogy a felettébb idegesítő Richard két évtizeddel később irigyelt, és köztiszteletben álló milliárdossá válik. Vajon mindezek tudatában Peggy Sue megragadja az alkalmat, hogy változtasson sorsán?",
