    "original_title": "Con Air",
    "overview": "A Fegyencjárat egy repülőgép, amelynek utaslistáját az ország legelvetemültebb bűnözőiből állítják össze. Cyrus Grissom, a Vírus (John Malkovich) és a többiek mind életfogytiglanra ítélt gyilkosok, akiket az ország legbiztonságosabb börtönébe akarnak átszállítani. Közéjük kerül Cameron Poe (Nicholas Cage), az amnesztiával szabaduló rohamosztagos. Ő családjához térne haza, de váratlanul tudomásul kell vennie, hogy megpróbáltatásai folytatódnak. Nem az ügyész, hanem az élet folyamodott súlyosbításért; ami az elkövetkezendő huszonnégy órában vár rá, ahhoz képest az elmúlt nyolc börtönév kismiska. A rabok kiszabadulnak és eltérítik a gépet. Poe pedig tudja, nincs más választása, mint záros határidőn belül visszaszerezni az irányítást. A földön hajukat tépő rendőrök ugyanis nem fognak válogatni az eszközökben, hogy - esetleg egy ártatlannal együtt - eltakarítsanak egy légi-rakomány szennyest.",
