    "overview": "Joe (Nicolas Cage) egy favágó brigád vezetője, aki sittes múlttal, de amennyire tőle telik, tisztességesen és keményen próbál boldogulni, sőt, még bizonyos határig embereket is képes közel engedni magához. Gary (Tye Sheridan) egy családnak nem nevezhető rettenetben él, két alkoholista, munkanélküli ronccsal, akik a szülei, és akik közül az apja folyamatosan veri, és elszedi tőle minden pénzét. A fiú néma kishúga és anyja miatt nem lép le, hanem munkásnak jelentkezik Joe-nál, és ezzel mindkettőjük sorsát megváltoztatja.",
