    "overview": "A film megtörtént esetet dolgoz fel, amelyben egy alaszkai járőr összefog egy fiatal lánnyal, aki megszökött a sorozatgyilkos Robert Hansen karmai közül, hogy igazságot szolgáltasson. The Frozen Ground – Az igazság a történet mögött Robert Christian Hansen (született február 15, 1939) amerikai sorozatgyilkos. 1980 és 1983 között, Hansen meggyilkolt 17 és 21 közötti nőket az alaszkai Anchorage, mellett. Elítélték 1983-ban, és jelenleg 461 éves börtönbüntetését tölti a Spring Creek Correctional Center-ben Seward-ben, Alaszkában. Hivatalos szinopszis: A The Frozen Ground-ot egy hihetetlen igaz történet ihlette, amely Jack Halcombe (Cage) alaszkai állami nyomozót követi nyomon, ahogy elindul, hogy véget vessen Robert Hansen (Cusack) gyilkos tombolásának, egy sorozatgyilkos, aki észrevétlen maradt 13 évig.",
