    "overview": "Waters és Stone két senki, aki irodistaként dolgozik a rendőrségnél, ahol stiklikkel egészítik ki fizetésüket. Amikor Stone fülébe jut, hogy egy heroindíler hatalmas összeget tart egy széfben, a két barát elkezdni követni a pénz nyomait, melyek egy kis élelmiszerboltba vezetnek. A tervük nem is lehet más, mint hogy feltörik a széfet, és osztoznak a zsákmányon. Csakhogy amikor rájönnek, mit is rejt valójában a széf, már túl késő, hogy visszaforduljanak.",
