    "overview": "Edward Snowden nem akart mást, csak a hazáját szolgálni egy jó hazafi katonaként. Karrierjének azonban egészségi állapota csakhamar véget vet, ezáltal informatikusként tud elhelyezkedni a seregben, méghozzá a titkosszolgálati részlegen. Miután megkapja új állását, egészen elképesztő felfedezésre jut, lévén kideríti, hogy az amerikai kormány szinte bárkit képes lefülelni az egész világon. Ha kell, telefonokat hallgatnak le, elektronikus üzeneteket olvasnak el, de akár webkamerán keresztül is megfigyelhetik a célpontot a saját otthonában.\r Snowden ekkor válaszút elé kerül! Vagy továbbra is rendületlenül hisz az Amerikai Egyesült Államokban, a szabadságban, ezáltal asszisztál a kormány illegális cselekedetei mellé, vagy inkább óriási botrányt kirobbantva nyilvánosságra hozza az összes olyan információt, amit megtudott a munkája során, ám ebben az esetben egy életre szóló menekülés vár rá.",
