    "overview": "Texas legtüzesebb DJ-jének, Jungle Julia-nak az alkony leszállta azt jelzi, hogy eljött a lazulás ideje két legjobb barátnője társaságában. A három szexi bombázó beleveti magát az éjszakába, megbolondítva és felgerjesztve a bárok törzsközönségének vágyait. Ám a feléjük irányuló figyelem közül nem mindegyik mondható ártatlannak. Valaki titokban minden lépésüket követi. Stuntman Mike, a sebhelyes arcú, cserzett bőrű férfi, gyilkos pillantásokkal fixírozza őket felturbózott autójának kormánya mögül. A lányok sörük felett ülve nem is sejtik, hogy a parkolóban, pár méterre tőlük, Mike már túráztatja halálos fegyverét, végzetes masináját.",
