    "overview": "A vámpír árnyéka egy gondolatkísérlet. Az opus Murnau Nosferatujának (1922) forgatásáról szól, annak a filmnek az elkészültéről mesél, melyet neves rendezője minden idők leghitelesebb mozijaként kívánt leforgatni. Murnau céljának elérése érdekében munkája főszereplőjéül egy valóságos vámpírt szerződtet Max Schreck személyében. A rendező mindent megbocsát színészének, Schreck valamennyi szeszélyét elnézően kezeli és ez szép lassan oda vezet, hogy a színészek gárdája, valamint a stáb erősen megfogyatkozik. Murnaunak szembe kell néznie a problémával: ha be akarja fejezni filmjét, igyekeznie kell, mielőtt ő is Schreck áldozatául esik.",
