    "original_title": "The Life of David Gale",
    "overview": "David Gale (Kevin Spacey) egész életében a halálbüntetés ellen küzdött, egyetemi előadásokat tartott, könyveket írt, felvonulásokat szervezett. A sors, a nagy játékos azonban különös fordulatot tartogatott számára: a férfi most a siralomházban várja saját kivégzését, mert a texasi bíróság halálra ítélte őt egy kolléganője megerőszakolásáért és meggyilkolásáért.Bitsey Bloom (Kate Winslet), a helyi lap újságírója azonnal lecsap a témára. Ám sokkal többet kap, mint egy interjút: feladatot. A halálraítélt ugyanis elmeséli neki egész életét - és részletesen vall arról az összeesküvésről, amelynek következtében most halálba küldik. Bitsey úgy érzi, egy ártatlan ember élete múlik rajta, és elhatározza, hogy David Gale instrukciói alapján elkapja és leleplezi az igazi gyilkost. Ha szerencséje van, még azelőtt, mielőtt a professzort a kivégzőkamrába vezetik.",
