    "original_title": "Next",
    "overview": "Cris \"Frank Cadillac\" Johnson (Nicolas Cage) ismer egy trükköt, amit senki sem tud utánacsinálni: Cris képes megmondani, mi fog következni a közeljövőben, pontosabban az elkövetkezendő két percben. Eme tulajdonságára építi azt a showműsort, amivel Las Vegasban lép fel nap mint nap, ugyanakkor a jövőbelátás jól jön a kártyaasztalnál is, ha épp egy kis pénzre van szüksége. Különleges képességére azonban hamarosan fény derül, s Cris a figyelem központjába kerül: a kaszinók biztonsági őrei mindent megtesznek azért, hogy lebuktassák különös játékmódszerei miatt, ugyanakkor az FBI antiterrorista osztályának ügynöke, Callie Ferris (Julianne Moore) egyre csak győzködi, hogy állítsa adottságát a globális terrorizmus ellen folytatott küzdelem szolgálatába. Kitartása érthető, hisz Cris jelenthetné a leghatásosabb fegyvert a terror ellen...",
